window.bookSummaryJSON = "<p><b>The Leath are fighting for their Gods, but Bethany Anne is fighting for freedom.</b> </p> <p><i>Then the Leath make a very fatal mistake.</i></p> <p>On another planet, the Leath dishonor the Etheric Empire's warriors, and Bethany Anne unleashes her new avatar, and there will be hell to pay.</p> <p><b><i>For those who believe Might Makes Right, Bethany Anne is about to explain how that can be so, so wrong.</i></b></p> <p>Listen to the latest Bethany Anne adventure that can make you laugh out loud, shed a tear, and yell for the good guys as they fight evil in another galaxy.</p> <p><b>One ass-kicking at a time.</b></p>"; 
